// Import necessary dependencies and components
import React from 'react';
import './StartPage.css';
import LoginPage from '../LoginPage/LoginPage';

// Define the StartPage component
const StartPage = () => {
  // Function to handle button click and navigate to the login page
  const handleLoginClick = () => {
    // You may need to add code to handle navigation to the login page here
    console.log('Login button clicked');
  };

  return (
    <div>
      <header>
        <img src="logo.png" alt="Logo" />
        <p>PB App</p>
      </header>

      <section className="side-by-side-sections">
        <div className="left-section">
          <h1>Personal Budget App</h1>
          <p>A personal-budget management app</p>
          <div className="button-container">
            {/* Use the handleLoginClick function as the onClick handler */}
            <button onClick={handleLoginClick}>Login</button>
            <button>Signup</button>
          </div>
        </div>
        <div className="right-section">
          <img src="sidepic.png" alt="Logo" />
        </div>
      </section>
    </div>
  );
}

// Export the StartPage component
export default StartPage;
